INSERT INTO `progetto_ricerca` (`id_progetto`, `nome`, `descrizione`, `data_avvio`, `data_fine`, `budget`, `id_area_ricerca`) VALUES
(6, 'A novel and integrated approach to increase multiple combined stress tolerance in plants using tomato as a model (TomRes)\n', 'The project “A NOVEL AND INTEGRATED APPROACH TO INCREASE MULTIPLE AND COMBINED STRESS TOLERANCE IN PLANTS USING TOMATO AS A MODEL”, in short TOMRES, is co-funded by the Horizon 2020 Programme of the European Union. The overall goal of TOMRES is to enhance resilience to combined water and nutrient stress in tomato and to maximize water (WUE) and nutrient use efficiency (NUE) by designing and testing in the field (open and protected) novel combinations of genotypes and management practices reducing the environmental impact of agricultural activities.\n', '2013-08-05', '2017-06-17', 820.00, 13),
(7, 'Accelerating Innovative practices for Spraying Equipment, Training and Advising in European agriculture through the mobilization of Agricultural Knowledge and Innovation Systems (INNOSETA)\n', 'Il Progetto INNOSETA (Innovative practices for Spraying Equipment, Training and Advising in European agriculture through the Mobilization of Agricultural Knowledge and Innovation Systems) è finanziato dalla Commissione Europea nell ambito del “Programma Quadro europeo per la Ricerca e l Innovazione (2014 – 2020) HORIZON 2020” e vede la partecipazione di 14 partner europei tra Università, Enti di ricerca, associazioni di costruttori di macchine irroratrici e di agricoltori. Con tale progetto si intende istituire una rete tematica autosufficiente e innovativa sulla protezione delle colture e l uso sostenibile dei prodotti fitosanitari (irroratrici, formazione e consulenza) per contribuire a colmare il divario tra i numerosi progetti di ricerca europei e l utilizzo che fanno gli agricoltori di tutto questo. Il progetto promuove lo scambio di nuove idee e informazioni tra l industria, l università, i centri di ricerca e la comunità agricola in modo che le soluzioni scientifiche e commerciali esistenti possano essere ampiamente diffuse e applicate, identificando le esigenze del settore.\n', '2015-03-29', '2021-07-08', 9883.00, 12),
(8, 'Developing SUstainable PERmanent Grassland systems and policies (SUPER-G)\n', 'The existence and management of permanent grasslands (PG) is key to the delivery of multiple ecosystem services (ES) across Europe. However, PG maintenance and functions are under threat from sub-optimal management of inputs, cultivation in higher output farming systems and abandonment in remote and marginal areas.\n', '2013-12-19', '2018-10-20', 2799.00, 12),
(9, 'FoodConnects (EITFOOD)\n', '', '2013-06-09', '2021-07-10', 8599.00, 13),
(10, 'Linking genetic resources, genomes and phenotypes of Solanaceous crops (G2P-SOL)\n', 'G2P-SOL aims at bringing into full fruition the seeds from tens of thousands of genetic accessions of the four major Solanaceous food crops (potato, tomato, pepper and eggplant) that are stored in ‘genebanks  worldwide.\n', '2014-01-13', '2019-06-14', 3755.00, 13),
(11, 'Network for effective knowledge transfer on safe and economic wastewater reuse in agriculture in Europe (SuWaNu Europe)\n', 'SUWANU EUROPE is an EU funded projected focused on the reuse of reclaimed water for irrigation in agriculture. The reason behind is that wastewater when treated according to appropriate standards and methods has a strong potential to complement conventional water resources used in agricultural irrigation.\n', '2012-10-06', '2020-03-04', 5024.00, 13),
(12, 'Optimised Pest Integrated Management to precisely detect and control plant diseases in perennial crops and open-field vegetables (OPTIMA)\n', 'Il Progetto europeo OPTIMA (Optimised Pest Integrated Management to precisely detect and control plant diseases in perennial crops and open-field vegetables) è finanziato dalla Commissione Europea nell ambito del “Programma Quadro europeo per la Ricerca e l Innovazione (2014 – 2020) HORIZON 2020”.\n', '2012-04-22', '2020-12-04', 472.00, 12),
(13, 'Safe and economic wastewater reuse in agriculture in Europe (SUWANU PLUS)\n', '', '2012-06-13', '2020-03-11', 6883.00, 13),
(14, 'Towards Innovation - driven and smart solutions in short food supply chains (SMARTCHAIN)\n', 'SMARTCHAIN is an ambitious, 3 year project with 43 partners from 11 European countries including key stakeholders from the domain of short food supply chain as actors in the project. The central objective is to foster and accelerate the shift towards collaborative short food supply chains and, through concrete actions and recommendations, to introduce new robust business models and innovative practical solutions that enhance the competitiveness and sustainability of the European agri-food system.\n', '2012-09-25', '2021-11-06', 1559.00, 13),
(15, 'Towards coordinated microbiome R&I activities in the food system to support (EU and) international bioeconomy goals (MicrobiomeSupport)\n', 'MicrobiomeSupport has integrated international partners form Brazil, Canada, South Africa, China, Argentina, Australia, New Zealand, India and USA to improve the international cooperation and coordination of common bioeconomy research programmes and set a basis for common microbiome R&I agendas.\n', '2015-06-05', '2017-07-18', 6905.00, 10),
(16, 'Biogas and digestate with controlled ammonia content by a virtuous biowaste cycle withintegrated bio&chemical processes (LIFECAB)\n', 'Biowaste management has become a major issue because of the increasing amount of biowastes.\n', '2015-08-09', '2020-01-07', 7493.00, 13),
(17, 'Forage system for less GHG emissions an more soil carbon sink in continental and agricultural mediterranean areas (LIFE Forage4Climate)\n', 'Forage4Climate vuole aumentare la consapevolezza degli agricoltori e dei tecnici sui reali benefici delle BP per la mitigazione dei cambiamenti climatici anche a scala aziendale, dimostrandone le ricadute economiche positive.\n', '2014-04-29', '2016-01-05', 5576.00, 12),
(18, 'GRowing AviaN in Apennine s Tuscany HeathlAnds (LIFE GRANATHA)\n', 'Il progetto è finalizzato al miglioramento dello stato di conservazione delle popolazioni di alcune specie di uccelli inserite nell Allegato I della DC 2009/147/CEE legate agli habitat di brughiera montana (habitat 4030 “Lande secche europee” con abbondante presenza di E. scoparia) presenti nella ZPS “Pascoli e cespuglieti montani del Pratomagno”.\n', '2015-11-14', '2016-04-14', 5708.00, 13),
(19, 'Improvement and disclosure of efficient techniques for manure management towards a circularand sustainable agriculture (LIFE AGRICLOSE)\n', 'La gestione delle deiezioni zootecniche è difficile nelle zone con un elevata densità di aziende agricole, e ancor più se queste sono circondate da colture dove di solito non si utilizzano deiezioni, come gli alberi da frutto.\n', '2012-10-14', '2017-03-24', 8245.00, 12),
(20, 'PEsticide Reduction using Friendly and Environmentally Controlled Technologies (PERFECT LIFE)\n', 'Il Progetto quadriennale LIFE PERFECT (PEsticide Reduction using Friendly and Environmentally Controlled Technologies) ha l obiettivo generale di dimostrare come sia possibile ridurre il rischio di contaminazione ambientale (fauna, flora e uomo) da prodotti fitosanitari e loro metaboliti nell aria attraverso l adozione di strumenti per regolazione ottimale della velocità e del volume di aria erogata (OVRA)\n', '2014-11-05', '2021-06-30', 7662.00, 12),
(21, 'Spatial containment of Vespa velutina in Italy and establishment of an Early Warning and Rapid Response System (LIFE STOPVESPA)\n', 'Le azioni previste da STOPVESPA consentiranno di raccogliere ed elaborare informazioni sulla presenza e gli impatti della Vespa velutina, definire delle linee guida d intervento per la neutralizzazione dei nidi coloniali, sviluppare nuove tecniche di monitoraggio, neutralizzare i nidi, valutare le vie di diffusione della specie, allestire un sistema di allerta e risposta rapida a livello nazionale, produrre materiali divulgativi.\n', '2014-12-05', '2019-12-27', 1895.00, 13),
(22, 'An introduction to food systems: scientific, technical and socioeconomic principles to facilitate the creation of food value networks\n', '', '2014-03-01', '2020-06-22', 2293.00, 12),
(23, 'C-SNIPER: Campylobacter-Specific Nullification via Innovative Phage-mediated Enteropathogen Reduction (C-SNIPER)\n', 'Consumption of poultry, especially chicken meat, is considered the most common route for human infection. Colonization of broiler chickens at farm level leads to transmission of Campylobacter along the production chain, resulting in contamination of poultry meat at retail level.\n', '2015-04-19', '2016-12-04', 7844.00, 13),
(24, 'Engaging with Controversies in the Food System\n', '', '2014-03-19', '2021-08-06', 6124.00, 13),
(25, 'Focus on Farmers\n', '', '2013-08-15', '2020-10-03', 3735.00, 12),
(26, 'Food System Master of Science Program (FOOD SYSTEM)\n', 'The programme is based on a combination of essential entrepreneurial skills, which will help you to become an effective innovator, and key technical skills that are tailored to your career ambition in the sector.\n', '2012-02-02', '2019-11-15', 1786.00, 13),
(27, 'Food System Master of Science Program (Master Food System)\n', 'The integrated Master in Food Systems will equip a new generation of top talent with the skills, competences and knowledge to become innovators and entrepreneurs in the Food sector.\n', '2013-01-04', '2017-09-13', 9108.00, 12),
(28, 'SME Workshop: Supporting SMEs for new business opportunities\n', '', '2013-04-01', '2016-09-11', 6255.00, 12),
(29, 'Trust in the food we eat (TRUST)\n', '', '2013-10-21', '2017-07-03', 7971.00, 13),
(30, 'Attività innovative per lo sviluppo della filiera transfrontaliera del fiore edule (ANTEA)\n', 'La crisi che il comparto della floricoltura ha avuto negli ultimi anni ha indotto un ri-orientamento di molte piccole e medie aziende agricole su specie adatte a mercati alternativi pur mantenendo la stessa tipologia produttiva...\n', '2012-06-15', '2020-09-10', 680.00, 12),
(31, 'Development of ecosystem-based risk governanceconcepts with respect to natural hazards and climate impacts - from riskassessment to ecosystem based solutions (GreenRisk4ALPs)\n', 'GreenRisk4Alps will establish, test and implement new forestry and ecosystem-based management in the Alpine region. Integrated user-tailored and territorially specific risk management systems for natural hazards such as rock fall, avalanches, debris flows and torrents will be implemented in six Pilot Action Regions balancing numerous interests, demands and costs.\n', '2014-07-11', '2018-06-27', 1708.00, 13),
(32, 'Harmonised ROCKfall natural risk and protection forest mapping in the ALPine Space (ROCKtheALPS)\n', 'In natural hazard management and disaster risk reduction worldwide, but especially in the Alpine Space , forests are increasingly considered equal to technical or civil engineering measures...\n', '2015-09-14', '2017-01-06', 2277.00, 13),
(33, 'Informaplus (Informaplus)\n', 'Le Alpi Occidentali presentano un estesissima superficie forestale che in alcune regioni è superiore al 50%: una risorsa, da amministrare con attenzione e nel contempo un opportunità di lavoro per le popolazioni transfrontaliere.\n', '2012-11-18', '2019-10-17', 3520.00, 12),
(34, 'Innovation sanitaire pour la durabilité des exploitations apicoles (Innov Api)\n', 'Il progetto Innov Api mira a costruire un protocollo tecnico, basato su esperimenti sul campo in apiari professionali e su esperimenti in un apiario in condizioni controllate. Questo il protocollo tecnico deve consentire di adattare e di divulgare questa procedura di controllo della varroa.\n', '2015-12-12', '2018-12-26', 8794.00, 12),
(35, 'Linking Alpine Soil Knowledge to Sustainable Ecosystem Management and Capacity Building (Links4Soils)\n', 'I suoli alpini, dove mettiamo radici\n', '2012-07-07', '2019-05-18', 9855.00, 12),
(36, 'Strategie innovative per lo sviluppo di filiere verdi transfrontaliere (FINNOVER)\n', 'Il progetto prevede un processo di trasferimento di conoscenze fra Università, Enti di ricerca, Strutture di Servizi per le imprese e le PMI già attive sul territorio, con le finalità..', '2014-04-21', '2020-06-06', 6899.00, 12);
